Marianne Brandon Ph.D, &quot;Monogamy: The Untold Story (Sex, Love, and Psychology)&quot;
Publisher: Praeger | ISBN 10: 0313385734 | 2010 | PDF | 182 pages | 1.2 MB

Monogamous relationships are firmly embedded in the framework of our society, and yet the divorce rate and common failures of intimacy in long-term relationships challenges the efficacy of this paradigm. Oddly, the concept of monogamy has been virtually ignored by mental health professionals, while anthropologists, sociologists, biologists, and zoologists have researched and explored.
